import './App.css';
import {Route,Routes} from 'react-router';



import Home from './components/Home';
import About from './components/About';
import Book from './components/Book';
import Menu from './components/Menu';

function App() {
  return (
    <div className="App">
      <Home/>
      <Menu/>
      <About/>
      <Book/>

      <Routes>
        <Route path='/' Component={<Home/>}/>
      </Routes>
      </div>
  );
}

export default App;
